import React, { useState, useEffect } from 'react';
import { getAssignedPlans, getProgress } from '../../service/api'; // API calls to fetch plans and progress

const TraineeDashboard = () => {
  const [plans, setPlans] = useState([]);
  const [progress, setProgress] = useState([]);

  useEffect(() => {
    const fetchPlans = async () => {
      try {
        const assignedPlans = await getAssignedPlans();
        setPlans(assignedPlans);
      } catch (error) {
        console.error('Error fetching plans:', error);
      }
    };

    const fetchProgress = async () => {
      try {
        const progressData = await getProgress();
        setProgress(progressData);
      } catch (error) {
        console.error('Error fetching progress:', error);
      }
    };

    fetchPlans();
    fetchProgress();
  }, []);

  return (
    <div>
      <h2>Trainee Dashboard</h2>

      <h3>Assigned Plans</h3>
      {plans.length > 0 ? (
        plans.map((plan) => (
          <div key={plan._id}>
            <h4>{plan.planName}</h4>
            <p>Exercise Type: {plan.exerciseType}</p>
            <p>Duration: {plan.duration} minutes</p>
            <p>Workout Type: {plan.workoutType}</p>
          </div>
        ))
      ) : (
        <p>No plans assigned</p>
      )}

      <h3>Progress</h3>
      {progress.length > 0 ? (
        progress.map((item, index) => (
          <div key={index}>
            <h4>{item.status}</h4>
            <p>{item.date}</p>
            <p>{item.details}</p>
          </div>
        ))
      ) : (
        <p>No progress available</p>
      )}
    </div>
  );
};

export default TraineeDashboard;
